import React, { Component } from 'react';
import { Slide } from 'react-slideshow-image';
import Header from "./common/Header";
import Global from '../config/Global'

export default class Slider extends Component {
  render() {
    let images = [
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,',
      'data:image/jpeg;base64,'
    ];

    const properties = {
      duration: 5000,
      transitionDuration: 500,
      infinite: true,
      indicators: true,
      arrows: true
    };

    return(
      <div>
        <Header title={"SLIDER EXAMPLE"}/>
        <div style={{margin: 10, backgroundColor: Global.LEMON, alignItems: 'center'}}>
          <Slide {...properties}>
            {images.map((img, index) => (
              <div>
                <div style={{'backgroundImage': `url(${img})`, backgroundRepeat  : 'no-repeat', backgroundPosition: 'center', backgroundSize: 'cover', height: 500}}>
                  <span>Slide {index+1}</span>
                </div>
              </div>
            ))}
          </Slide>
        </div>
      </div>
    )
  }
}

